    const getList = () => {
        carServices.getAll()
            .then(response => {
                setCar(response.data);
                console.log(response.data);
            })
            .catch(e => {
                console.log(e);
            });

    };


    return (


        <div className="container ">
       <h2 style={{ fontFamily: 'Roboto', fontWeight: 'bold', color:"white" }}>The best vehicle option to rent with us</h2>

